INSERT INTO `email_template` (`template_id`, `template_name`, `text`, `createDate`, `updateDate`) VALUES
(1, 'Email Template For Request', '<p>Dear&nbsp;<span style=\"color: rgb(51, 51, 51); font-size: 14px;\">{Employee Name}, we received your request for leave for the following dates&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">{Dates of the Leave Request}</span><font color=\"#333333\"><span style=\"font-size: 14px;\">. A member of the&nbsp;Benefits department will be reviewing your request for approval.</span></font></p><p><span style=\"font-size: 14px; color: rgb(51, 51, 51);\">You can expect to receive a follow up email within the next 3 business days.</span><br></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">Thank you</span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></span></p><p><br></p>', '2020-08-07 06:01:53', '2021-01-29 10:16:27'),
(2, 'Email Template For Approved', '<p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">Dear {Employee Name},</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">We have reviewed your request for leave and is tentatively APPROVED.&nbsp; &nbsp;A Leave packet will be emailed to your personal email address one month prior to the start of your leave, or as soon as possible.&nbsp; Please be sure to return any requested forms on time so we can finalize the dates of approval.&nbsp;&nbsp;</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">Please email benefits@tendertouch.com if there is any change in your scheduled leave.</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">Thank you</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p>', '2020-08-07 10:30:27', '2021-01-29 10:27:20'),
(3, 'Email Template For Rejected', '<p>Dear&nbsp;&nbsp;<span style=\"color: rgb(51, 51, 51); font-size: 14px;\">{Employee Name},</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">We have completed our review of your request for leave.&nbsp; After careful consideration, your request has been DENIED.</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">You can expect to receive a follow up email with additional information to explain our decision.</span></p><p><span style=\"color: rgb(51, 51, 51); font-size: 14px;\">Thank you</span></p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p>', '2020-08-07 10:30:40', '2021-01-29 10:29:41'),
(4, 'Email Template For Cancelled', '<p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">Dear {Employee Name},</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">We have received information that your recent request for a Leave of Absence for has been withdrawn.&nbsp; We will go ahead and CANCEL your request for leave.&nbsp; If this is an error, please email benefits@tendertouch.com.</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">Thank you</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p>', '2020-11-10 05:02:16', '2021-01-29 10:30:46');
