(161, NULL, '1', '{\"people\":\"self\",\"leaveFormId\":\"161\",\"first_name\":\"Kathryn\",\"last_name\":\"Mangapora\",\"contact_number\":\"8104298408\",\"email_id\":\"kmangapora15@gmail.com\",\"discipline\":\"OT\",\"state\":\"3862\",\"contact_method\":\"Email\",\"facility\":\"Hopkins \",\"leaveId\":\"1\",\"leave_reason\":\"1\",\"first_date_of_disability\":\"12\\/03\\/2020\",\"is_surgery_elective\":\"2\",\"last_day_work\":\"12\\/02\\/2020\",\"return_date\":\"01\\/04\\/2021\",\"date_flexible\":\"no\",\"employee_signature\":\"\",\"signed_date\":\"11\\/30\\/-0001\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"11\\/30\\/-0001\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Good afternoon- \\r\\n\\r\\nI am reaching out to request a leave of absence as I am continuing to have problems with my knee. It pains me to say that my tendon graft has re-ruptured for the second time and I am scheduled for surgery December 3rd. My physical therapy was cut short due to Covid and while I gained enough strength to walk, run, etc I did not have the strength to protect my knee while catching myself after I tripped. \\r\\n\\r\\nRecovery is between 4-6 weeks but based off my previous surgeries I expect to be back to work within a month. I have informed my DOR and coworkers. \\r\\n\\r\\nThanks in advance for your assistance.\\r\\nKaty Mangapora\",\"request_status\":\"Approved\"}', '2020-12-02', '2021-01-04', 0, 'no', '', '1969-12-31', '', '1969-12-31', 'MANGAPORA,_KATHRYN_(1).pdf', 'Approved', NULL, NULL, 'Kathryn', 'Mangapora', '8104298408', 'OT', '3862', 'Email', 'kmangapora15@gmail.com', 'Hopkins ', '2020-10-25', 'Elida Sanchez', 'Good afternoon- \r\n\r\nI am reaching out to request a leave of absence as I am continuing to have problems with my knee. It pains me to say that my tendon graft has re-ruptured for the second time and I am scheduled for surgery December 3rd. My physical therapy was cut short due to Covid and while I gained enough strength to walk, run, etc I did not have the strength to protect my knee while catching myself after I tripped. \r\n\r\nRecovery is between 4-6 weeks but based off my previous surgeries I expect to be back to work within a month. I have informed my DOR and coworkers. \r\n\r\nThanks in advance for your assistance.\r\nKaty Mangapora', '2020-10-25 17:19:10', '2020-10-26 16:49:16', 'self', '0000-00-00', 1),
