(170, NULL, '6', '{\"people\":\"self\",\"leaveFormId\":\"170\",\"first_name\":\"Chloe\",\"last_name\":\"Trave\",\"contact_number\":\"6092144506\",\"email_id\":\"chloetrave@gmail.com\",\"discipline\":\"SLP\",\"state\":\"3859\",\"contact_method\":\"Phone\",\"facility\":\"Preferred Care at Old Bridge\",\"leaveId\":\"6\",\"leave_reason\":\"6\",\"what_are_the_travel_dates\":\"10\\/21\\/2020\",\"which_location_will_you_be_traveling_to\":\"Arizona \",\"last_day_work\":\"10\\/21\\/2020\",\"return_date\":\"11\\/09\\/2020\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"11\\/30\\/-0001\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"11\\/30\\/-0001\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"I am not on leave, but was asked by my supervisor to fill out this form. Preferred Care has a strict 14 day quarantine policy for travel restrictions despite recommendations from CDC and NJ Dept of Health to not include essential employees in these travel restrictions. I will still be working at Summerhill once my second negative covid test comes back,  as well as other buildings who need my assistance who are okay with my travel and using the CDC recommendation for health care essential workers to return to work after 2 negative covid tests.  I will be happy to return from my 2 week leave earlier from preferred if\\/when they allow! \",\"request_status\":\"Cancel Request\"}', '2020-10-21', '2020-11-09', 0, 'yes', '', '1969-12-31', '', '1969-12-31', 'F268A63F-C880-478B-B9E8-EB9F951B504C.jpeg,9A426E6F-F4A3-4303-B380-F63731033299.jpeg,C1411FAA-3A79-4251-B9B0-7A81746DE9D1.png', 'Cancel Request', NULL, NULL, 'Chloe', 'Trave', '6092144506', 'SLP', '3859', 'Phone', 'chloetrave@gmail.com', 'Preferred Care at Old Bridge', '2020-10-27', 'Elida Sanchez', 'I am not on leave, but was asked by my supervisor to fill out this form. Preferred Care has a strict 14 day quarantine policy for travel restrictions despite recommendations from CDC 