(210, NULL, '7', '{\"people\":\"self\",\"leaveFormId\":\"210\",\"first_name\":\"Sarah\",\"last_name\":\"Ferraro\",\"contact_number\":\"6317076393\",\"email_id\":\"Ferraro.j.sarah@gmail.com\",\"discipline\":\"OT\",\"state\":\"3862\",\"contact_method\":\"Email\",\"facility\":\"Medford Multicare Center\",\"leaveId\":\"7\",\"leave_reason\":\"7\",\"start_date\":\"11\\/12\\/2020\",\"what_is_your_test_date\":\"11\\/12\\/2020\",\"last_day_work\":\"11\\/12\\/2020\",\"return_date\":\"11\\/23\\/2020\",\"date_flexible\":\"no\",\"employee_signature\":\"\",\"signed_date\":\"11\\/30\\/-0001\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"11\\/30\\/-0001\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\" I had been swabbed on Wednesday 11\\/11\\/20 for COVID-19 at my facility, Medford Multicare Center. I was notified by my facility on 11\\/12\\/20 that I am positive for COVID-19. I went on to receive confirmation from City MD on 11\\/12\\/20 that I am in fact positive for COVID-19. \\r\\n\\r\\nI will attach proof of my positive swab obtained on 11\\/12\\/20 from City MD to this form. I will also attach the \\u2018proof of positive test form\\u2019 from Suffolk County Department of Health to this form. \\r\\n\\r\\nAs a result of my positive COVID-19 Swab, I was required to leave work early on 11\\/12\\/13 and am mandated to quarantine for 10 days following. I am in need of being paid out accordingly during this mandated quarantine period without lowering my PTO balance.  The dates for payout include 11\\/12\\/20 (1.5 hours) and 11\\/13\\/20-11\\/23\\/20. The estimated return to work day of 11\\/23\\/20 provided an improvement in respiratory symptoms and without fever.  Thank you for your assistance.\",\"request_status\":\"Approved\"}', '2020-11-12', '2020-11-23', 0, 'no', '', '1969-12-31', '', '1969-12-31', 'Proof_of_positive_COVID_status_for_Sarah_Ferraro.pdf,Isolation_Order_for_Sarah_Ferraro.pdf,24E803BC-6CE6-4D0B-BE53-64078435E983.png,227FA32D-B4BE-4176-8986-29363FD2C5BE.png,28E61E50-227C-4ABB-89A1-8FE0D6CBC7C4.jpeg', 'Approved', NULL, NULL, 'Sarah', 'Ferraro', '6317076393', 'OT', '3862', 'Email', 'Ferraro.j.sarah@gmail.com', 'Medford Multicare Center', '2020-11-13', 'Maria Korey', ' I had been swabbed on Wednesday 11/11/20 for COVID-19 at my facility, Medford Multicare Center. I was notified by my facility on 11/12/20 that I am positive for COVID-19. I went on to receive confirmation from City MD on 11/12/20 that I am in fact positive for COVID-19. \r\n\r\nI will attach proof of my positive swab obtained on 11/12/20 from City MD to this form. I will also attach the proof of positive test form from Suffolk County Department of Health to this form. \r\n\r\nAs a result of my positive COVID-19 Swab, I was required to leave work early on 11/12/13 and am mandated to quarantine for 10 days following. I am in need of being paid out accordingly during this mandated quarantine period without lowering my PTO balance.  The dates for payout include 11/12/20 (1.5 hours) and 11/13/20-11/23/20. The estimated return to work day of 11/23/20 provided an improvement in respiratory symptoms and without fever.  Thank you for your assistance.', '2020-11-13 15:28:06', '2020-11-13 17:19:48', 'self', '0000-00-00', 1),
