(242, NULL, '7', '{\"people\":\"self\",\"leaveFormId\":\"242\",\"first_name\":\"Zachary\",\"last_name\":\"Barnick\",\"contact_number\":\"9084126592\",\"email_id\":\"barnick1.zach@gmail.com\",\"discipline\":\"Rehab Aide\",\"state\":\"3859\",\"contact_method\":\"Email\",\"facility\":\"Complete Care at Green Knoll\",\"leaveId\":\"7\",\"leave_reason\":\"7\",\"start_date\":\"11\\/20\\/2020\",\"what_is_your_test_date\":\"11\\/17\\/2020\",\"last_day_work\":\"11\\/20\\/2020\",\"return_date\":\"11\\/27\\/2020\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"12\\/31\\/1969\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"12\\/31\\/1969\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"As requested by my employer I took a routinely manual (nasal swab) COVID-19 test Tuesday, 11\\/17\\/2020 at Urgent Care. While at work on Friday, 11\\/20\\/2020 the doctor called back to say that the result was Positive. I was and still am asymptomatic, but following protocol I was sent home. Prior to returning home I was given both rapid, and manual test (with swab) in the parking lot. Rapid test result was Negative. Received Negative result from manual test Sunday evening, 11\\/22\\/2020 from supervisor. Told by HR for return to work Friday, 11\\/27\\/2020. I am wondering if it was a false positive, and if I should be tested for whether I still have the antibody. As a reminder, I was out for a month with COVID-19 from 4\\/8-5\\/7. My parents, brother and fiancee have tested negative since this latest occurrence.\",\"request_status\":\"Approved\"}', '2020-11-20', '2020-11-27', 0, 'yes', '', '1969-12-31', '', '1969-12-31', NULL, 'Approved', NULL, NULL, 'Zachary', 'Barnick', '9084126592', 'Rehab Aide', '3859', 'Email', 'barnick1.zach@gmail.com', 'Complete Care at Green Knoll', '2020-11-23', 'Maria Korey', 'As requested by my employer I took a routinely manual (nasal swab) COVID-19 test Tuesday, 11/17/2020 at Urgent Care. While at work on Friday, 11/20/2020 the doctor called back to say that the result was Positive. I was and still am asymptomatic, but following protocol I was sent home. Prior to returning home I was given both rapid, and manual test (with swab) in the parking lot. Rapid test result was Negative. Received Negative result from manual test Sunday evening, 11/22/2020 from supervisor. Told by HR for return to work Friday, 11/27/2020. I am wondering if it was a false positive, and if I should be tested for whether I still have the antibody. As a reminder, I was out for a month with COVID-19 from 4/8-5/7. My parents, brother and fiancee have tested negative since this latest occurrence.', '2020-11-23 19:09:42', '2020-11-25 17:55:24', 'self', '0000-00-00', 1);
