(423, NULL, '7', '{\"people\":\"self\",\"leaveFormId\":\"423\",\"first_name\":\"Emily\",\"last_name\":\"Phillips\",\"contact_number\":\"4435216334\",\"email_id\":\"emily.phillips1101@gmail.com\",\"discipline\":\"OT\",\"state\":\"3834\",\"contact_method\":\"Email\",\"facility\":\"Atlantic Shores Millsboro, DE\",\"leaveId\":\"7\",\"leave_reason\":\"7\",\"start_date\":\"01\\/11\\/2021\",\"what_is_your_test_date\":\"01\\/05\\/2021\",\"how_do_you_believe_you_contracted_the_covid_19_illness_please_provide_details_on_why_you_came_to_that_conclusion_be_specific_with_details\":\"I believe I contracted the COVID-19 virus through the workplace. During the week that I tested positive I had only been in my home where no one has s\\/s of COVID or a positive test and the workplace. I work on the unit of the building where the residents with COVID-19 reside. Proper PPE was worn by myself, though it was removed while I was on the unit for eating and drinking and the virus is airborne.\",\"with_the_greatest_effort_to_protect_your_privacy_can_you_describe_your_work_and_out_of_work_activities_that_may_have_led_to_this_covid_19_illness\":\"32\",\"work_activities\":\"Providing personal care for residents including bathing\\/dressing, toileting, assisting patients in functional mobility tasks requiring hands-on contact. Residents wearing masks throughout treatment sessions though at times removing masks.\",\"are_there_any_other_instances_in_the_work_environment_that_could_contribute_to_contracting_covid_19_what_actions_specifically_led_to_your_belief_that_you_contracted_covid_19_through_work\":\"PPE removed while still on unit for eating\\/drinking though socially distanced from patients and coworkers. \",\"last_day_work\":\"01\\/08\\/2021\",\"return_date\":\"01\\/15\\/2021\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"11\\/30\\/-0001\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"11\\/30\\/-0001\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Curative COVID-19 testing performed 1\\/5\\/2021 returned positive for the virus. Proper PPE worn while in the workplace per workplace recommendations. During the week of testing had not been anywhere other than work (primarily on the COVID unit) and my home where my fianc\\u00e9 has had no s\\/s of COVID and no exposure to anyone with a positive test or s\\/s of the virus. Prior to this week when in the community, recommended PPE of mask while in all public places was followed. Frequent hand washing performed both at work and within the home. \",\"request_status\":\"Approved\"}', '2021-01-08', '2021-01-15', 0, 'yes', '', '1969-12-31', '', '1969-12-31', NULL, 'Approved', NULL, NULL, 'Emily', 'Phillips', '4435216334', 'OT', '3834', 'Email', 'emily.phillips1101@gmail.com', 'Atlantic Shores Millsboro, DE', '2021-01-09', 'Elida Sanchez', 'Curative COVID-19 testing performed 1/5/2021 returned positive for the virus. Proper PPE worn while in the workplace per workplace recommendations. During the week of testing had not been anywhere other than work (primarily on the COVID unit) and my home where my fianc has had no s/s of COVID and no exposure to anyone with a positive test or s/s of the virus. Prior to this week when in the community, recommended PPE of mask while in all public places was followed. Frequent hand washing performed both at work and within the home. ', '2021-01-09 17:40:09', '2021-01-11 18:40:11', 'self', '0000-00-00', 1),
