(426, NULL, '7', '{\"people\":\"self\",\"leaveFormId\":\"426\",\"first_name\":\"Lauren\",\"last_name\":\"Saal\",\"contact_number\":\"7325134342\",\"email_id\":\"laurensaal@gmail.com\",\"discipline\":\"SLP\",\"state\":\"3859\",\"contact_method\":\"Email\",\"facility\":\"Complete Care at Shorrock Gardens\",\"leaveId\":\"7\",\"leave_reason\":\"7\",\"start_date\":\"01\\/08\\/2021\",\"what_is_your_test_date\":\"01\\/11\\/2021\",\"how_do_you_believe_you_contracted_the_covid_19_illness_please_provide_details_on_why_you_came_to_that_conclusion_be_specific_with_details\":\"I believe I contracted the virus from work. I work with positive patients at the two buildings I work at everyday. In the morning I go to Laurelton, and in the afternoon I go to Shorrock Gardens. I have not travelled or gone anywhere in the last year. \",\"with_the_greatest_effort_to_protect_your_privacy_can_you_describe_your_work_and_out_of_work_activities_that_may_have_led_to_this_covid_19_illness\":\"32\",\"work_activities\":\"Working with positive patients at both buildings (Laurelton and Shorrock Gardens)\",\"are_there_any_other_instances_in_the_work_environment_that_could_contribute_to_contracting_covid_19_what_actions_specifically_led_to_your_belief_that_you_contracted_covid_19_through_work\":\"I have been reusing PPE at work. PPE is not always available (silk gowns at Laurelton). \",\"last_day_work\":\"01\\/11\\/2021\",\"return_date\":\"01\\/22\\/2021\",\"date_flexible\":\"no\",\"employee_signature\":\"\",\"signed_date\":\"11\\/30\\/-0001\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"11\\/30\\/-0001\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Covid-19 test came back positive. \",\"request_status\":\"Approved\"}', '2021-01-11', '2021-01-22', 0, 'no', '', '1969-12-31', '', '1969-12-31', NULL, 'Approved', NULL, NULL, 'Lauren', 'Saal', '7325134342', 'SLP', '3859', 'Email', 'laurensaal@gmail.com', 'Complete Care at Shorrock Gardens', '2021-01-11', 'Elida Sanchez'