(575, NULL, '7', '{\"people\":\"self\",\"first_name\":\"Naomi \",\"last_name\":\"Morris\",\"contact_number\":\"845-826-3681\",\"email_id\":\"Nangel21@gmail.com\",\"discipline\":\"OT\",\"state\":\"3859\",\"contact_method\":\"Email\",\"facility\":\"Dellridge Health and Rehab.\",\"leave_reason\":\"7\",\"how_do_you_believe_you_contracted_the_covid_19_illness_please_provide_details_on_why_you_came_to_that_conclusion_be_specific_with_details\":\"Work, if true positive because I am not putting myself in situations of exposure otherwise. Feel it could be false positive however, since test from 27th was positive and test both rapid and pcr on 28th were negative. \",\"with_the_greatest_effort_to_protect_your_privacy_can_you_describe_your_work_and_out_of_work_activities_that_may_have_led_to_this_covid_19_illness\":\"32\",\"work_activities\":\"Working with Covid + pts. \",\"are_there_any_other_instances_in_the_work_environment_that_could_contribute_to_contracting_covid_19_what_actions_specifically_led_to_your_belief_that_you_contracted_covid_19_through_work\":\"I stay home and nobody else sick, two other family members had it months back and I was negative then. \",\"last_day_work\":\"01\\/28\\/2021\",\"return_date\":\"02\\/08\\/2021\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"I was informed Thursday Jan. 28th that my test from the 27th was positive for Covid 19. I took a rapid and a PCR test right after being informed and both resulted in negative findings. I was told however from director of nursing that I was required to be out 10 days quarantine. My boss did want to contact tendertouch first though, to discuss this. I have not heard anything and am now filling in the LOA request for the week. I know it will be only PTO used, unless I start showing symptoms, which I haven\\u2019t had any. I am willing to work with PPE as I had been, even positive, but this is not accepted from facility. \"}', '2021-01-28', '2021-02-08', 0, 'yes', '', '1970-01-01', '', '1970-01-01', NULL, 'Approved', NULL, NULL, 'Naomi ', 'Morris', '845-826-3681', 'OT', '3859', 'Email', 'Nangel21@gmail.com', 'Dellridge Health and Rehab.', '2021-02-02', 'Elida Sanchez', 'I was informed Thursday Jan. 28th that my test from the 27th was positive for Covid 19. I took a rapid and a PCR test right after being informed and both resulted in negative findings. I was told however from director of nursing that I was required to be out 10 days quarantine. My boss did want to contact tendertouch first though, to discuss this. I have not heard anything and am now filling in the LOA request for the week. I know it will be only PTO used, unless I start showing symptoms, which I havent had any. I am willing to work with PPE as I had been, even positive, but this is not accepted from facility. ', '2021-02-03 03:35:11', '2021-02-03 22:49:22', 'self', '0000-00-00', 1),
