(607, NULL, '7', '{\"people\":\"self\",\"first_name\":\"Cheryl\",\"last_name\":\"Bonham\",\"contact_number\":\"9894303702 \",\"email_id\":\"clmapes4789@gmail.com\",\"discipline\":\"OT\",\"state\":\"3862\",\"contact_method\":\"Email\",\"facility\":\"Hopkins \",\"leave_reason\":\"7\",\"how_do_you_believe_you_contracted_the_covid_19_illness_please_provide_details_on_why_you_came_to_that_conclusion_be_specific_with_details\":\"I believe I contracted the virus work as I tested positive 2 days after a CNA that worked on the floor I was treating on tested positive. \",\"with_the_greatest_effort_to_protect_your_privacy_can_you_describe_your_work_and_out_of_work_activities_that_may_have_led_to_this_covid_19_illness\":\"32\",\"work_activities\":\"My daily work schedule requires that I work on the units in close contact with CNAs, Nurse and patients for at least 7 hours a day. \",\"are_there_any_other_instances_in_the_work_environment_that_could_contribute_to_contracting_covid_19_what_actions_specifically_led_to_your_belief_that_you_contracted_covid_19_through_work\":\"Quarantine was lifted in our facility, and though I continued to wear PPE when in contact with patients, there\\u2019s are times on the unit that require me to be in the nursing station without full PPE for computer use and medical chart review. \",\"last_day_work\":\"02\\/18\\/2021\",\"return_date\":\"02\\/22\\/2021\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"I was sent home on 2\\/11 after receiving two positive COVID-19 rapid swabs. I was instructed to get a PCR swab on 2\\/12 in the community and the results came back negative. I am awaiting DOH and CDC recommendations on my return to work guidelines. \"}', '2021-02-18', '2021-02-22', 0, 'yes', '', '1970-01-01', '', '1970-01-01', NULL, 'Approved', NULL, NULL, 'Cheryl', 'Bonham', '9894303702 ', 'OT', '3862', 'Email', 'clmapes4789@gmail.com', 'Hopkins ', '2021-02-15', 'Maria Korey', 'I was sent home on 2/11 after receiving two positive COVID-19 rapid swabs. I was instructed to get a PCR swab on 2/12 in the community and the results came back negative. I am awaiting DOH and CDC recommendations on my return to work guidelines. ', '2021-02-16 01:33:29', '2021-02-16 23:41:19', 'self', '0000-00-00', 1),
