(630, NULL, '5', '{\"people\":\"self\",\"first_name\":\"Yatri\",\"last_name\":\"Raval\",\"contact_number\":\"9403374195\",\"email_id\":\"ravalyatri1990@gmail.com\",\"discipline\":\"PT\",\"state\":\"3834\",\"contact_method\":\"Email\",\"facility\":\"Atlantic Shores Rehabilitation Center \",\"leave_reason\":\"5\",\"has_your_regional_manager_approved_yes_no_options\":\"10\",\"last_day_work\":\"03\\/14\\/2021\",\"return_date\":\"04\\/18\\/2021\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Greetings of the day, \\r\\nThis is Yatri Raval, Physical Therapist from Atlantic shores rehabilitation center, Millsboro, DE-19966.\\r\\nI am requesting personal leave of absence as I am vising India for H1b stamping followed by my wedding. \\r\\nI am departing on 12th March which is my day off and arriving back on 16th April which is Friday so I can get back to work on Sunday 18th April as my normal work day if I do not have to quarantine. So, in total I will be out for 5 weeks considering 2 weeks of quarantine in India. \\r\\nAS per Doreen, Delaware don\\u2019t have any mandatory Quarantine after travel, but updated information from Doreen, according to CDC required 7days of quarantine which can be waive if facility administration allowed me to came back to work with negative covid-19 test result. \\r\\nI will use my PTO\'s as much as I could use and the reminder can be unpaid which is okay for me at this moment as this visit is very important for me as I will be getting married there.\\r\\nI submitted my PTO request to my supervisor before finalized dates as I am working on appointment dates of my H1B stamping. Please find attached copy of previous and updated PTO request. \\r\\nI approved my PTO\\u2019s from regional and Jessica (HR) which will be paid out when I will return. \\r\\nThank You,\\r\\nYatri Raval.\\r\\n\",\"file_name\":[\"PTO_Request1_Yatri.jpeg\",\"PTO_updatedRequest2_Yatri.jpeg\"],\"file_status\":[\"Success\",\"Success\"]}', '2021-03-14', '2021-04-18', 0, 'yes', '', '1970-01-01', '', '1970-01-01', 'PTO_Request1_Yatri.jpeg,PTO_updatedRequest2_Yatri.jpeg', 'Approved', NULL, NULL, 'Yatri', 'Raval', '9403374195', 'PT', '3834', 'Email', 'ravalyatri1990@gmail.com', 'Atlantic Shores Rehabilitation Center ', '2021-02-26', 'Elida Sanchez', 'Greetings of the day, \r\nThis is Yatri Raval, Physical Therapist from Atlantic shores rehabilitation center, Millsboro, DE-19966.\r\nI am requesting personal leave of absence as I am vising India for H1b stamping followed by my wedding. \r\nI am departing on 12th March which is my day off and arriving back on 16th April which is Friday so I can get back to work on Sunday 18th April as my normal work day if I do not have to quarantine. So, in total I will be out for 5 weeks considering 2 weeks of quarantine in India. \r\nAS per Doreen, Delaware dont have any mandatory Quarantine after travel, but updated information from Doreen, according to CDC required 7days of quarantine which can be waive if facility administration allowed me to came back to work with negative covid-19 test result. \r\nI will use my PTO\'s as much as I could use and the reminder can be unpaid which is okay for me at this moment as this visit is very important for me as I will be getting married there.\r\nI submitted my PTO request to my supervisor before finalized dates as I am working on appointment dates of my H1B stamping. Please find attached copy of previous and updated PTO request. \r\nI approved my PTOs from regional and Jessica (HR) which will be paid out when I will return. \r\nThank You,\r\nYatri Raval.\r\n', '2021-02-26 20:46:02', '2021-02-26 21:33:34', 'self', '0000-00-00', 1),
