(657, NULL, '7', '{\"people\":\"self\",\"first_name\":\"La Verne\",\"last_name\":\"Tint\",\"contact_number\":\"6462074465\",\"email_id\":\"lavernetint@yahoo.com\",\"discipline\":\"OT\",\"state\":\"3859\",\"contact_method\":\"Email\",\"facility\":\"Family of Caring @ Ridgewood\",\"leave_reason\":\"7\",\"how_do_you_believe_you_contracted_the_covid_19_illness_please_provide_details_on_why_you_came_to_that_conclusion_be_specific_with_details\":\"I am not sick nor having any Covid symptoms. My temperature today is 96.7. I was told my PCR test on 3\\/13\\/21 came out positive. I suppose I was exposed at the Covid wing on my 1st week. \",\"with_the_greatest_effort_to_protect_your_privacy_can_you_describe_your_work_and_out_of_work_activities_that_may_have_led_to_this_covid_19_illness\":\"32\",\"work_activities\":\"I started work at FOC Ridgewood on 3\\/5\\/21. I\'ve only been in the building on 3\\/5, 3\\/6, 3\\/7, 3\\/8, 3\\/13,3\\/14 & 3\\/15. I have been 3x in the Covid wing on my 1st week. I was told my PCR test on 3\\/13 came out positive. My routine has been work\\/home. I\'ve only gone to the grocery a couple times within those dates stated.I went to the Covid wing 3x \",\"are_there_any_other_instances_in_the_work_environment_that_could_contribute_to_contracting_covid_19_what_actions_specifically_led_to_your_belief_that_you_contracted_covid_19_through_work\":\"I\'m not sure what could have contributed to it. The only time I took off my mask was when eating my lunch on 3\\/6, 3\\/7, 3\\/13\\/, & 3\\/14. I have followed all precautions (proper  PPE, frequent handwashing, etc.\",\"last_day_work\":\"03\\/15\\/2021\",\"return_date\":\"03\\/27\\/2021\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"I was informed by my Supervisor that my PCR test on 3\\/13\\/21 came out positive. I don\'t feel sick or experiencing any symptoms but as required, have to quarantine due to the positive PCR results. I was told by HR department that I am to file a leave of absence due to quarantine purposes &  not being able to come to work secondary to positive Covid result.\"}', '2021-03-15', '2021-03-27', 0, 'yes', '', '1970-01-01', '', '1970-01-01', NULL, 'Approved', NULL, NULL, 'La Verne', 'Tint', '6462074465', 'OT', '3859', 'Email', 'lavernetint@yahoo.com', 'Family of Caring @ Ridgewood', '2021-03-16', 'Elida Sanchez', 'I was informed by my Supervisor that my PCR test on 3/13/21 came out positive. I don\'t feel sick or experiencing any symptoms but as required, have to quarantine due to the positive PCR results. I was told by HR department that I am to file a leave of absence due to quarantine purposes &  not being able to come to work secondary to positive Covid result.', '2021-03-16 20:55:43', '2021-03-16 21:19:24', 'self', '0000-00-00', 1),
