(659, NULL, '5', '{\"people\":\"self\",\"first_name\":\"Latoya\",\"last_name\":\"Thompson\",\"contact_number\":\"3476578976 \",\"email_id\":\"nadinet80@yahoo.com\",\"discipline\":\"Rehab Aide\",\"state\":\"3862\",\"contact_method\":\"Phone\",\"facility\":\"The Dumont Center for Nursing Rehabilitation \",\"leave_reason\":\"5\",\"has_your_regional_manager_approved_yes_no_options\":\"10\",\"last_day_work\":\"03\\/23\\/2021\",\"return_date\":\"04\\/12\\/2021\",\"date_flexible\":\"no\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Requesting time off from March 24th until April 9th. I had been informed by my child care provider, that child services will not be provided on the above days.  Given the current situation that we are experiencing with the pandemic, finding child care has been difficult.  Therefore, am requesting time off on the above dates with the understanding that, I currently have 3 days PTO.\\r\\n\\r\\n \\r\\n\\r\\n\"}', '2021-03-23', '2021-04-12', 0, 'no', '', '1970-01-01', '', '1970-01-01', NULL, 'Approved', NULL, NULL, 'Latoya', 'Thompson', '3476578976 ', 'Rehab Aide', '3862', 'Phone', 'nadinet80@yahoo.com', 'The Dumont Center for Nursing Rehabilitation ', '2021-03-16', 'Elida Sanchez', 'Requesting time off from March 24th until April 9th. I had been informed by my child care provider, that child services will not be provided on the above days.  Given the current situation that we are experiencing with the pandemic, finding child care has been difficult.  Therefore, am requesting time off on the above dates with the understanding that, I currently have 3 days PTO.\r\n\r\n \r\n\r\n', '2021-03-17 00:31:33', '2021-03-17 20:14:02', 'self', '0000-00-00', 1),
(661, NULL, '1', '{\"people\":\"self\",\"first_name\":\"Michael\",\"last_name\":\"Gillis\",\"contact_number\":\"7165239877\",\"email_id\":\"mgillis@buffalo.edu\",\"discipline\":\"PT\",\"state\":\"3869\",\"contact_method\":\"Email\",\"facility\":\"Tulip Special Care\",\"leave_reason\":\"1\",\"is_surgery_elective\":\"2\",\"last_day_work\":\"03\\/17\\/2021\",\"return_date\":\"04\\/02\\/2021\",\"date_flexible\":\"yes\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Fell on an outstretched hand 3-11-21 which resulted in pain in the R elbow, but did not hurt that much. On 3-14-21 I lifted an oxygen tank overhead, twisted it into an oxygen tank holder when the R elbow made an audible \\\"pop\\\" noise. By 3-16-21 my elbow wasn\'t getting better so I went to urgent care and then the ER where X-rays and CT scans were taken that revealed a fracture of the R side Ulna. I am awaiting an upper arm specialist on Friday to determine work limitations, surgery if needed, and return to work timeline.\"}', '2021-03-17', '2021-04-02', 0, 'yes', '', '1970-01-01', '', '1970-01-01', NULL, 'Approved', NULL, NULL, 'Michael', 'Gillis', '7165239877', 'PT', '3869', 'Email', 'mgillis@buffalo.edu', 'Tulip Special Care', '2021-03-17', 'Maria Korey', 'Fell on an outstretched hand 3-11-21 which resulted in pain in the R elbow, but did not hurt that much. On 3-14-21 I lifted an oxygen tank overhead, twisted it into an oxygen tank holder when the R elbow made an audible \"pop\" noise. By 3-16-21 my elbow wasn\'t getting better so I went to urgent care and then the ER where X-rays and CT scans were taken that revealed a fracture of the R side Ulna. I am awaiting an upper arm specialist on Friday to determine work limitations, surgery if needed, and return to work timeline.', '2021-03-17 20:05:38', '2021-03-18 22:24:36', 'self', '0000-00-00', 1),
(662, NULL, '7', '{\"people\":\"self\",\"first_name\":\"Kelly\",\"last_name\":\"Genovese \",\"contact_number\":\"516-376-7074\",\"email_id\":\"Kellyg0726@aol.com\",\"discipline\":\"OT\",\"state\":\"3862\",\"contact_method\":\"Email\",\"facility\":\"Grandell Rehab and Nursing Center\",\"leave_reason\":\"7\",\"how_do_you_believe_you_contracted_the_covid_19_illness_please_provide_details_on_why_you_came_to_that_conclusion_be_specific_with_details\":\"From 2 positive patients at work\",\"with_the_greatest_effort_to_protect_your_privacy_can_you_describe_your_work_and_out_of_work_activities_that_may_have_led_to_this_covid_19_illness\":\"32\",\"work_activities\":\"I was exposed to 2 covid positive patients within a week. I evaluated a new patient from the hospital and 2 days later they were hospitalized with symptoms and tested positive for covid. A second patient tested positive a few days later (they were on same unit for a short time frame) and I worked with that patient for a few days between their test and getting the results. I became symptomatic 4-5 days after the last patients positive.  Out of work activities are very limited. I only spend time with my immediate family and go out only for necessities.\",\"are_there_any_other_instances_in_the_work_environment_that_could_contribute_to_contracting_covid_19_what_actions_specifically_led_to_your_belief_that_you_contracted_covid_19_through_work\":\"Exposure to 2 positive patients\",\"last_day_work\":\"03\\/12\\/2021\",\"return_date\":\"03\\/29\\/2021\",\"date_flexible\":\"no\",\"employee_signature\":\"\",\"signed_date\":\"\",\"superviser_signature\":\"\",\"superviser_sign_date\":\"\",\"discussed_supervisor\":\"1\",\"sup_date\":\"\",\"comment_status\":\"Covid 19 positive\",\"file_name\":[\"report-129041844.pdf\"],\"file_status\":[\"Success\"]}', '2021-03-12', '2021-03-29', 0, 'no', '', '1970-01-01', '', '1970-01-01', 'report-129041844.pdf', 'Approved', NULL, NULL, 'Kelly', 'Genovese ', '516-376-7074', 'OT', '3862', 'Email', 'Kellyg0726@aol.com', 'Grandell Rehab and Nursing Center', '2021-03-17', 'Maria Korey', 'Covid 19 positive', '2021-03-17 20:28:21', '2021-03-19 00:12:49', 'self', '0000-00-00', 1),
