INSERT INTO `punch_email_template` (`template_id`, `template_name`, `text`, `subject`, `createDate`, `updateDate`) VALUES
(1, 'Email Template For Supervisor New Request', '<p class=\"MsoNormal\">Dear Supervisor,<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\">The following time adjustment request had been submitted for\r\nyour approval.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Employee Name:</b> {Employee Name}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Facility:</b> {Employee Facility}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Punch Date:</b> {Dates of the Punch Request}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Reason for request:</b> {Punch Reason}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><b>Comments:</b> {Comment}</p><p class=\"MsoNormal\"><br></p>\r\n\r\n<p class=\"MsoNormal\">Please click on the link below and follow the prompts to\r\napprove or deny.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\">{URL}</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><span style=\"color: rgb(0, 0, 0); font-size: 13px;\">Thank you</span><br></p><p class=\"MsoNormal\"><o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\">&nbsp;<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"background:yellow;mso-highlight:yellow\">***\r\nPlease email the Payroll Department directly with any questions. This email is\r\nbeing sent from an unmonitored inbox ***</span><o:p></o:p></p>', 'TARF Approval Needed', '2020-12-23 05:27:55', '2021-01-19 13:29:27'),
(2, 'Email Template For Employee New Request', '<p class=\"MsoNormal\">Dear {Employee Name},<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">The following time adjustment request had been submitted to your\r\nsupervisor for approval.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNoSpacing\"><b>Employee Name:</b> {Employee Name}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Facility:</b> {Employee Facility}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Punch Date:</b> {Dates of the Punch Request}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Reason for request:</b> {Punch Reason}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Comments:</b> {Comment}</p><p class=\"MsoNoSpacing\"><o:p></o:p></p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p><p class=\"MsoNormal\">You will receive an email confirmation once they\r\napprove/deny the request.<o:p></o:p></p><p class=\"MsoNormal\">Thank you</p><p class=\"MsoNormal\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span style=\"background:yellow;mso-highlight:yellow\">*** Please\r\nemail your Supervisor directly with any questions. This email is being sent from\r\nan unmonitored inbox ***<o:p></o:p></span></p>', 'TARF Confirmation', '2020-12-23 05:27:55', '2021-01-19 13:29:37'),
(3, 'Email Template For Employee Approved', '<p class=\"MsoNormal\">Dear {Employee Name},<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">The following time adjustment request has been <u>approved</u> by your supervisor.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNoSpacing\"><b>Employee Name:</b> {Employee Name}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Facility:</b> {Employee Facility}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Punch Date:</b> {Dates of the Punch Request}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Reason for request:</b> {Punch Reason}<o:p></o:p></p><p class=\"MsoNoSpacing\"><b>Comments:</b> {Comment}</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p><p class=\"MsoNormal\">You will receive an email confirmation once processing is completed\r\nby the Payroll Department.<o:p></o:p></p><p class=\"MsoNormal\">Thank you<o:p></o:p></p><p class=\"MsoNoSpacing\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<span style=\"font-size:11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;background:yellow;mso-highlight:yellow;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">***\r\nPlease email your Supervisor directly with any questions. This email is being\r\nsent from an unmonitored inbox ***</span><br></p>', 'TARF Approved', '2020-12-23 05:27:55', '2021-01-19 13:29:52'),
(4, 'Email Template For Employee Denied', '<p class=\"MsoNormal\">Dear {Employee Name},<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\">The following time adjustment request has been <u>denied</u> by your\r\nsupervisor.<o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Employee Name:</b> {Employee Name}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Facility:</b> {Employee Facility}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Punch Date:</b> {Dates of the Punch Request}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Reason for request:</b> {Punch Reason}<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><b>Comments:</b> {Comment}</p>\r\n\r\n<p class=\"MsoNormal\">Thank you<o:p></o:p></p>\r\n\r\n<p class=\"MsoNoSpacing\"><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"background:yellow;mso-highlight:yellow\">*** Please\r\nemail your Supervisor directly with any questions. This email is being sent from\r\nan unmonitored inbox ***<o:p></o:p></span></p>', 'TARF Denied', '2020-12-23 05:27:55', '2021-01-19 13:30:07'),
(5, 'Email Template For Employee Canceled', '<p class=\"MsoNormal\">The following time adjustment request has been canceled by the Payroll Department.<br></p><p class=\"MsoNormal\"><o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Employee Name:</span>&nbsp;{Employee Name}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Facility:</span>&nbsp;{Employee Facility}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Punch Date:</span>&nbsp;{Dates of the Punch Request}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Reason for request:</span>&nbsp;{Punch Reason}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Comments:</span>&nbsp;{Comment}</p><p class=\"MsoNormal\">Thank you<o:p></o:p></p><p class=\"MsoNoSpacing\"><o:p>&nbsp;</o:p></p><p class=\"MsoNormal\"></p><p class=\"MsoNormal\"><span style=\"background: yellow;\">*** Please email the Payroll Department directly with any questions. This email is being sent from an unmonitored inbox ***</span></p>', 'TARF Canceled', '2020-12-23 10:37:27', '2021-01-19 13:30:21'),
