(7, 'Email Template For Supervisor Completed', '<p class=\"MsoNormal\">The following time adjustment request has been processed.<o:p></o:p></p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Employee Name:</span>&nbsp;{Employee Name}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Facility:</span>&nbsp;{Employee Facility}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Punch Date:</span>&nbsp;{Dates of the Punch Request}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Reason for request:</span>&nbsp;{Punch Reason}<o:p></o:p></p><p class=\"MsoNoSpacing\"><span style=\"font-weight: 700;\">Comments:</span>&nbsp;{Comment}</p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\"><br></p><p class=\"leave_lable\" style=\"color: rgb(51, 51, 51); font-size: 14px;\">{URL}</p>', 'TARF Completed', '2021-01-19 05:32:47', '2021-01-25 02:44:37'),
